import React from "react";

import {Navbar} from "react-bootstrap";

class NavigationBar extends React.Component{
    render() {
        return (
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand href="/"><img />Hotels</Navbar.Brand>
            </Navbar>
        );
    }
}

export default NavigationBar;
